import React, { PureComponent } from 'react'

export class SubscriptionIntro extends PureComponent {
  render() {
    return (
      <div class='mb-10'>
        {/*begin::Title*/}
        <h5 class='mb-4'>Breif Details:</h5>
        {/*end::Title*/}
        {/*begin::Details*/}
        <div class='d-flex flex-wrap py-5'>
          {/*begin::Row*/}
          <div class='flex-equal me-5'>
            {/*begin::Details*/}
            <table class='table fs-6 fw-bold gs-0 gy-2 gx-2 m-0'>
              {/*begin::Row*/}
              <tr>
                <td class='text-gray-400 min-w-175px w-175px'>Taken On:</td>
                <td class='text-gray-800 min-w-200px'>
                  <a
                    href='../../demo2/dist/pages/apps/customers/view.html'
                    class='text-gray-800 text-hover-primary'
                  >
                    2022-01-10
                  </a>
                </td>
              </tr>
              {/*end::Row*/}
              {/*begin::Row*/}
              <tr>
                <td class='text-gray-400'>Customer Name:</td>
                <td class='text-gray-800'>Suurya Prabhat</td>
              </tr>
              {/*end::Row*/}
              {/*begin::Row*/}
              <tr>
                <td class='text-gray-400'>Address:</td>
                <td class='text-gray-800'>Gole Market, Lucknow - 560001</td>
              </tr>
              {/*end::Row*/}
              {/*begin::Row*/}
              <tr>
                <td class='text-gray-400'>Phone:</td>
                <td class='text-gray-800'>+91-7673925340</td>
              </tr>
              {/*end::Row*/}
            </table>
            {/*end::Details*/}
          </div>
          {/*end::Row*/}
          {/*begin::Row*/}
          <div class='flex-equal'>
            {/*begin::Details*/}
            <table class='table fs-6 fw-bold gs-0 gy-2 gx-2 m-0'>
              {/*begin::Row*/}
              <tr>
                <td class='text-gray-400 min-w-175px w-175px'>
                  Subscribed To:
                </td>
                <td class='text-gray-800 min-w-200px'>
                  <a href='#' class='text-gray-800 text-hover-primary'>
                    12 Months Standard Weight Plan
                  </a>
                </td>
              </tr>
              {/*end::Row*/}
              {/*begin::Row*/}
              <tr>
                <td class='text-gray-400'>Subscription Fees:</td>
                <td class='text-gray-800'>$149.99 / Year</td>
              </tr>
              {/*end::Row*/}
              {/*begin::Row*/}
              <tr>
                <td class='text-gray-400'>Billing method:</td>
                <td class='text-gray-800'>Annually</td>
              </tr>
              {/*end::Row*/}
              {/*begin::Row*/}
              <tr>
                <td class='text-gray-400'>Currency:</td>
                <td class='text-gray-800'>USD - US Dollar</td>
              </tr>
              {/*end::Row*/}
            </table>
            {/*end::Details*/}
          </div>
          {/*end::Row*/}
        </div>
        {/*end::Row*/}
      </div>
    )
  }
}

export default SubscriptionIntro
